import TypeFormsPage from './components/item/TypeFormsPage.vue';
import WeezEventPage from './components/item/WeezEventPage.vue';
import LinkedinPage from './components/item/LinkedInPage.vue';
import TwitterPage from './components/item/TwitterPage.vue';
import InstagramPage from './components/item/InstagramPage.vue';
import FacebookPage from './components/item/FacebookPage.vue';
const routes = [{
  path: process.env.VUE_APP_LOGIN,
  component: LoginPage
}, {
  path: process.env.VUE_APP_DASH,
  component: DashboardPage
}, {
  path: process.env.VUE_APP_TEST,
  component: TestPage
}, {
  path: process.env.VUE_APP_INSTA,
  component: InstagramPage
}, {
  path: process.env.VUE_APP_YOUTUBE,
  component: YoutubePage
}, {
  path: process.env.VUE_APP_METER,
  component: ReunioMeter
}, {
  path: process.env.VUE_APP_WPAS,
  component: WrongPage
}, {
  path: process.env.VUE_APP_404,
  component: Nf
}, {
  path: process.env.VUE_APP_TYPEFORMS,
  component: TypeFormsPage
}, {
  path: process.env.VUE_APP_WEEZEVENT,
  component: WeezEventPage
}, {
  path: process.env.VUE_APP_WEEZEVENT,
  component: LinkedinPage
}, {
  path: process.env.VUE_APP_TWITTER,
  component: TwitterPage
}, {
  path: process.env.VUE_APP_INSTAGRAM,
  component: InstagramPage
}, {
  path: process.env.VUE_APP_FACEBOOK,
  component: FacebookPage
}];
const router = createRouter({
  history: createWebHistory(),
  routes,
  mode: 'hash'
});

// app.config.globalProperties.$axios = axios;

const app = createApp(App);
app.config.globalProperties.$axios = axios;
app.use(router).mount('#app');
